import { createRouter, createWebHistory } from 'vue-router'
import Home from './views/Home.vue'
import Post from './views/Post.vue'

const routes = [
  { path: '/', component: Home },
  { path: '/post/:id', component: Post }
]

export default createRouter({
  history: createWebHistory(),
  routes
})
